import React from 'react';
import "./App.css";

import Preloader from './home/preloader';
import $ from "jquery";


function App() {

   $( function () {

    setTimeout(() => {

      $("#left-background").css("left",  "-50vw");

    }, 3000);

  })

  return (
    <div className="App">
        <Preloader />
        <div id="left-background">

        </div>
    </div>
  );
}

export default App;
